import "./css/index.css";

import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

import Landing from "./pages/Landing/Landing";

function App() {
  return (
    <Router>
      {/* I feel like we need a bigger width like Pen has to show the calendar and classes well */}
      {/* The pref max-w was max-w-7xl in case you want to go back */}
      <div className="max-w-full mx-auto px-4 sm:px-6 lg:px-8 py-4 h-full">
        <Switch>
          <Route exact path="/" component={Landing}></Route>
          <Route exact path="/search/" component={RatingSearch}></Route>
          <Route exact path="/about/" component={About}></Route>
          <Route exact path="/" component={Contact}></Route>
          <Route exact path="/profile/" component={Profile}></Route>
          <Route exact path="/settings/" component={Settings}></Route>
          <Route exact path="/login/" component={Login}></Route>

          {/* Test paths */}
          <Route exact path="/test/" component={Test}></Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
